import React from "react";

function Form() {
  return (
    <div className="form-group mx-sm-3 mb-2">
      <label for="inputPassword2" className="sr-only">
        Password
      </label>
      <input
        type="password"
        className="form-control"
        id="inputPassword2"
        placeholder="Password"
      ></input>
    </div>
  );
}

export default Form;
